import React from 'react'
import Tag from './Tag'
import styled from "styled-components";

const TagContainer = styled.div`
display: flex;
width: 50%;

`;
export default function Title() {
  return (
    <div>
    <div className=''></div>
        <h1>Cozy loft on the Canal Saint-Martin</h1>
        <p>Paris, Ile-de-France</p>
        <TagContainer><Tag />
        <Tag />
        <Tag /></TagContainer>
        
    </div>
  )
}
